        g5.createPro(y,138); 
          console.log("createI="+i);
    }
     eb.processDock(); 
    for (var i=0;i< g5.projectCount;i++){
         if(proArr[i]!= ""){ 
            var index='',project='',ass='';
            index = proArr[i].indexOf(":");
            project = proArr[i].substr(0,index);
            ass = proArr[i].substring(index+1);
            console.log(project);console.log(ass) ;

            if (ee.getText(cell.eeChildren[i].eeChildren[0]) != project){
                ee.setText(cell.eeChildren[i].eeChildren[0], project);
            }
            if(ass ==3){
                ee.setImage(cell.eeChildren[i].eeChildren[1], "/App1PJ/evaluation/studentEval/star1.gif", "fill"); 
                ee.setImage(cell.eeChildren[i].eeChildren[2], "/App1PJ/evaluation/studentEval/star2.gif", "fill");
                ee.setImage(cell.eeChildren[i].eeChildren[3], "/App1PJ/evaluation/studentEval/star3.gif", "fill");                
            }
            if(ass ==2){
                ee.setImage(cell.eeChildren[i].eeChildren[1], "/App1PJ/evaluation/studentEval/star1.gif", "fill"); 
                ee.setImage(cell.eeChildren[i].eeChildren[2], "/App1PJ/evaluation/studentEval/star2.gif", "fill");
                ee.setImage(cell.eeChildren[i].eeChildren[3], "/App1PJ/evaluation/studentEval/ashStar3.gif", "fill");
            }
            if(ass ==1){
                ee.setImage(cell.eeChildren[i].eeChildren[1], "/App1PJ/evaluation/studentEval/star1.gif", "fill"); 
                ee.setImage(cell.eeChildren[i].eeChildren[2], "/App1PJ/evaluation/studentEval/ashStar2.gif", "fill");
                ee.setImage(cell.eeChildren[i].eeChildren[3], "/App1PJ/evaluation/studentEval/ashStar3.gif", "fill");
            }
         }
